const data =
"";

function react(data_in)
{
    let current = data_in;
    let found=true;
    while(found){
        found=false;
        let next = "";
        let lcCur = current.toLowerCase();
        let len=current.length;

        let i=0;
        for (i=0; i<len-1; ++i){
            if ((current[i] != current[i+1]) && (lcCur[i] == lcCur[i+1])){
                // skip
                found=true;
                ++i;
            } else {
                next += current[i];
            }
        }
        if (i == len-1){
            next += current[i];
        }
        current=next;
    }
    return current.length;
}

function removePolymer(lcLetter, data_in, lcData_in)
{
    let data_out = "";
    const len = data_in.length;
    for (let i=0; i<len; ++i){
        if (lcData_in[i] != lcLetter){
            data_out += data_in[i];
        }
    }
    return data_out;
}

console.log("step 1 = " + react(data));

const alphabetLC = "abcdefghijklmnopqurstuvwxyz";

let minLen = data.length;
const lcData = data.toLowerCase();
for(const letter of alphabetLC)
{
    const thisLen = react(removePolymer(letter, data, lcData));
    if (thisLen < minLen){
        minLen = thisLen;
    }
}

console.log("step 2 = " + minLen);